import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './Home.css';

const Home = () => {
  const [featuredListings, setFeaturedListings] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchFeaturedListings();
  }, []);

  const fetchFeaturedListings = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/listings?limit=6');
      setFeaturedListings(response.data);
    } catch (error) {
      console.error('Error fetching listings:', error);
    } finally {
      setLoading(false);
    }
  };

  const categories = [
    { name: 'Property', icon: 'üè†', slug: 'property' },
    { name: 'Vehicles', icon: 'üöó', slug: 'vehicles' },
    { name: 'Electronics', icon: 'üíª', slug: 'electronics' },
    { name: 'Furniture', icon: 'ü™ë', slug: 'furniture' },
    { name: 'Clothing', icon: 'üëï', slug: 'clothing' },
  ];

  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>Welcome to RentLONA.com</h1>
          <p>Find everything you need to rent - from properties to electronics and more!</p>
          <div className="search-bar">
            <input
              type="text"
              placeholder="Search for rentals..."
              className="search-input"
            />
            <button className="search-btn">Search</button>
          </div>
        </div>
      </section>

      {/* Categories Section */}
      <section className="categories-section">
        <div className="container">
          <h2>Browse by Category</h2>
          <div className="categories">
            {categories.map((category) => (
              <Link
                key={category.slug}
                to={`/listings?category=${category.slug}`}
                className="category-card"
              >
                <div className="category-icon">{category.icon}</div>
                <h3>{category.name}</h3>
              </Link>
            ))}
          </div>
        </div>
      </section>

      {/* Featured Listings */}
      <section className="featured-section">
        <div className="container">
          <h2>Featured Listings</h2>
          {loading ? (
            <div className="loading">Loading featured listings...</div>
          ) : (
            <div className="listings-grid">
              {featuredListings.map((listing) => (
                <div key={listing._id} className="listing-card">
                  <div className="listing-image">
                    {listing.images && listing.images.length > 0 ? (
                      <img src={listing.images[0].url} alt={listing.title} />
                    ) : (
                      <div className="no-image">No Image</div>
                    )}
                  </div>
                  <div className="listing-info">
                    <h3>{listing.title}</h3>
                    <p className="price">${listing.price}/day</p>
                    <p className="location">{listing.location?.city || 'Location not specified'}</p>
                    <Link to={`/listings/${listing._id}`} className="btn btn-primary">
                      View Details
                    </Link>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </section>

      {/* Stats Section */}
      <section className="stats-section">
        <div className="container">
          <div className="stats">
            <div className="stat">
              <h3>1000+</h3>
              <p>Active Listings</p>
            </div>
            <div className="stat">
              <h3>500+</h3>
              <p>Happy Users</p>
            </div>
            <div className="stat">
              <h3>50+</h3>
              <p>Categories</p>
            </div>
            <div className="stat">
              <h3>24/7</h3>
              <p>Support</p>
            </div>
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="container">
          <h2>Ready to Rent or List?</h2>
          <p>Join thousands of users who trust RentLONA.com for their rental needs.</p>
          <div className="cta-buttons">
            <Link to="/register" className="btn btn-primary">Get Started</Link>
            <Link to="/listings" className="btn btn-secondary">Browse Listings</Link>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
